import React from 'react';

function WorkerList({ workers }) {
  // Calculate the number of rows needed
  const numRows = Math.ceil(workers.length / 3);

  return (
    <div className="worker-grid">
      {Array.from({ length: numRows }).map((_, rowIndex) => (
        <div className="worker-row" key={rowIndex}>
          {workers.slice(rowIndex * 3, (rowIndex + 1) * 3).map((worker, columnIndex) => (
            <div className="worker-col" key={columnIndex}>
              {/* Render worker information here */}
              <div>{worker.name}</div>
              <div>{worker.title}</div>
              {/* Add more worker information as needed */}
            </div>
          ))}
        </div>
      ))}
    </div>
  );
}

export default WorkerList;
